import AddIcon from "@mui/icons-material/Add";
import DeleteIcon from '@mui/icons-material/Delete';
import { useState } from "react";

function App() {
  const [state, setState] = useState(0);
  const ClickHandlerInc = () => {
    setState((prevValue) => {
      return (prevValue += 1);
    });
  };
  const ClickHandlerDec = () => {
    setState((prevValue) => {
      return (prevValue -= 1);
    });
  };

  return (
    <div className="App">
    div
      <h1>{state}</h1>
      <button onClick={ClickHandlerInc}>
        <AddIcon />
      </button>
      <button onClick={ClickHandlerDec}>
        <DeleteIcon />
      </button>
    </div>
  );
}

export default App;
